import logo from './../logo/call.png';
import './skills.css';

function Skills() {
    return (
        <div class="flip-card">
            <div class="flip-card-inner">
                <div class="flip-card-front">
                    <img src="avatar.png" alt="Avatar" width="300px" height="300px" />
                </div>
                    <div class="flip-card-back">
                        <h1>John Doe</h1>
                        <p>Architect & Engineer</p>
                    </div>
                </div>
            </div>
    );
}

export default Skills;
